import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbar from "./components/Navbar"; // شريط التنقل
import Header from "./components/Header"; // الهيدر
import Features from "./components/Features"; // الميزات
import Footer from "./components/Footer"; // الفوتر
import Login from "./pages/Login"; // صفحة تسجيل الدخول

function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route
          path="/"
          element={
            <>
              <Header />
              <Features />
              <Footer />
            </>
          }
        />
        <Route path="/login" element={<Login />} />
      </Routes>
    </Router>
  );
}

export default App;
